#include <bits/stdc++.h>
using namespace std;
#define faster() ios_base::sync_with_stdio(false);cin.tie();cout.tie();
#define matrix vector <vector<long long>>
#define MOD 1000000007
const long long big = 1e6;

int main() {
    faster();
    int t = 1;
    while ( t-- )
    {
        string s1, s2;
        getline(cin,s1);
        cin >> s2;
        do
        {
            int pos = s1.find(s2);
            if ( pos == -1 ) break;
            s1.erase(pos,s2.size());
        }
        while ( true );
        cout << s1;
    }
}

